inline LL mod_add(LL x, LL y)
{
	assert(0 <= x && x < mod);
	assert(0 <= y && y < mod);
	return x + y >= mod ? x + y - mod : x + y;
}
LL mod_mul(LL x, LL y)
{
	assert(0 <= x && x < mod);
	assert(0 <= y && y < mod);
	LL ret = 0;
	while(y)
	{
		if(y & dn)
			ret = mod_add(ret, x * (y & dn) % mod);
		x = x * dm % mod;
		y >>= dl;
	}
	return ret;
}
LL mod_inv(LL x)
{
	assert(0 <= x && x < mod);
	return x <= 1 ? x : mod - mod_mul(mod / x, mod_inv(mod % x));
}
LL F(LL n)
{
	assert(0 <= n && n < mod);
	LL ret = fact[n / delta];
	for(LL i = n / delta * delta + 1; i <= n; ++i)
		ret = mod_mul(ret, i);
	return ret;
}
LL C(ULL n, ULL m)
{
	if(n < m)
		return 0;
	if(n >= mod)
		return mod_mul(C(n % mod, m % mod), C(n / mod, m / mod));
	return mod_mul(F(n), mod_inv(mod_mul(F(m), F(n - m))));
}
int main()
{
	int t;
	ULL n, m, k;
	scanf("%d", &t);
	while(t--)
	{
		scanf("%llu%llu%llu", &n, &m, &k);
		printf("%lld\n", n > 0 && n - 1 >> 1 >= k && m > 0 && m - 1 >> 1 >= k ? mod_mul(C(n - 1, k << 1), C(m - 1, k << 1)) : k == 0);
	}
	return 0;
}
